{

    const changePage=(e)=>
    {
        onPageChange(e.target.dataset.id)
    }


    return(
        <div className="pagination">

            <div className="page-button" data-id="1" onClick={changePage}>1</div>
            <div className="page-button" data-id="2" onclick={changePage}>2</div>
            <div className="page-button" data-id="3" onclick={changePage}>3</div>
            <div className="page-button" data-id="4" onclick={changePage}>4</div>
            <div className="page-button" data-id="5" onclick={changePage}>5</div>




        </div>
    )

}

export default Pagination;
